import React from "react";
import "./Navbar.css"

function Navbar() {

  return (
    <div id="myMenu" className={"navbar-menu"}>
      <span><a data-menuanchor="Home" href="#Home">First</a></span>
      <span><a data-menuanchor="About" href="#About">Second</a></span>
      <span><a data-menuanchor="Resume" href="#Resume">Third</a></span>
    </div>
    )
}

export default Navbar;
